import { useState } from "react";

function DisplayName()
{
    let [name,setName]=useState("Nisha")
    return (
        <div>
        <input type="text" value={name}
        onChange={(e)=>{setName(e.target.value)}} />
        <h1 className='name'>{name}</h1>

        </div>

    );
}

export default DisplayName;
